                <button type='button' onClick={signUpFunc} className="submit_btn" value="Sign up">Sign Up</button>
              </div><br/>
              <h5>Already Have an Account! <Link to="/login" style={{textDecoration:'none'}}>LogIn Here</Link></h5>
            </div>
      </form>
      </div>
      </div>
      </>
  );
}

export default Sign_up
